        function populateGallery() {
            photoGrid.innerHTML = '';
            imageDataStrings.forEach((dataUri, index) => {
                if (dataUri.startsWith('data:image')) {
                    
                    const photoContainer = document.createElement('div');
                    photoContainer.className = 'relative w-full h-auto aspect-square bg-gray-200 rounded-lg shadow-md overflow-hidden';
                    
                    
                    const img = document.createElement('img');
                    img.src = dataUri;
                    img.alt = `Family Photo ${index + 1}`;
                    
                    img.className = 'w-full h-full object-cover pointer-events-none';
                    
                    
                    const overlay = document.createElement('div');
                    overlay.className = 'absolute inset-0 bg-transparent';

                    
                    photoContainer.appendChild(img);
                    photoContainer.appendChild(overlay);
                    
                    // Add the complete container to the grid
                    photoGrid.appendChild(photoContainer);
                }
            });
        }

        function login() {
            sessionStorage.setItem('isLoggedIn', 'true');
            populateGallery();
            passwordOverlay.classList.add('opacity-0', 'pointer-events-none');
            setTimeout(() => passwordOverlay.classList.add('hidden'), 300);
            galleryContainer.classList.remove('hidden');
            setTimeout(() => galleryContainer.classList.remove('opacity-0'), 50);
            body.classList.add('screenshot-proof');
        }
        
        // Simplified logout for testing
        function logout() {
            sessionStorage.removeItem('isLoggedIn');
            location.reload();
        }

        passwordForm.addEventListener('submit', (event) => {
            event.preventDefault();
            if (passwordInput.value.trim() === CORRECT_PASSWORD) {
                login();
            } else {
                errorMessage.textContent = 'Incorrect date.';
            }
        });

        
        document.addEventListener('contextmenu', (event) => event.preventDefault());

    </script>
